// REFS
const getRawPools = async function (){
	let res
	try{
		res = await fetch('https://mainnet-indexer.ref-finance.com/list-top-pools')
		if (res.status<199 || res.status>299) {return {error:res.statusText+' ('+res.status+')', code:res.status}}
		const text = await res.text()
		try{
			return JSON.parse(text)
		} catch(err){return {error:text}}
	} catch(err){return {error:err}}
}
const getPools = async function (){
	const res = {}, ids = ['0','1','4','5','79']
	const pools = await getRawPools()
	if (pools.error) return pools
	pools.filter(e => ids.indexOf(e.id)>=0).forEach(e => res['id'+e.id] = {pair:e.token_symbols, value:e.token0_ref_price})
	if (res['id79']) res['REF'] = Math.round(+res['id79'].value*10000)/10000
	if (res['id0']) res['SKYWARD'] = Math.round(+res['id0'].value*10000)/10000
	if (res['id1']) res['wETH'] = Math.round(+res['id1'].value*10000)/10000
	if (res['id5']) res['BANANA'] = Math.round(+res['id5'].value*10000)/10000
	if (res['id4']) res['wNEAR'] = Math.round(+res['id4'].value*10000)/10000
	return res
}
