getNFT = async function (accountId){
	try{
		const res = await fetch('https://helper.mainnet.near.org/account/'+accountId+'/likelyNFTs',{timeout:60000}) 
		if (res.status<199 || res.status>299) {return {error:res.statusText+' ('+res.status+')'}}
		const text = await res.text()
		try{
			return JSON.parse(text)
		} catch(err){return {error:text}}
	}catch(err){return {error:err}}
}
sendNFT = async function (ticker,accountId){
	let id = crypto.randomBytes(8).toString('hex')
	while (await ldb.getRec('lvWidget',id,1)) id = crypto.randomBytes(16).toString('hex')
	let tx = await near.mintNFT(id,{media:'https://near.watch/charts/'+id,copies:1}) 
	if (tx.error) return tx
 	tx = await near.transferNFT(id,accountId)
	if (tx.error) return tx
	const res = await ldb.setRec('lvWidget',id,ticker=='inf'?accountId:ticker,1)
	if (res.error) return res
	if (ticker=='inf') stat.addUser(accountId)
	return id
}

statistic = async (req,res) => {
	try{
		file = fs.readFileSync(svgPath+req.params.id+'_out.svg')
		res.writeHead(200,{'content-type':'image/svg+xml'})
		return res.end(file,'binary')
	}catch(err){console.log(err)}
	res.writeHead(301,{Location:'https://near.watch','cache-control':'no-store'})
	res.end()	
}	
widget = async (req,res) => {
	const outCab = req.headers['user-agent'] != 'TelegramBot (like TwitterBot)' && ((req.headers['referer'] != 'https://wallet.testnet.near.org/' && req.headers['referer'] != 'https://wallet.near.org/') || (req.headers['sec-fetch-dest'] && req.headers['sec-fetch-dest'] != 'image'))

	req.params.id = req.params.id.split('.')[0]
	const ticker = await ldb.getRec('lvWidget',req.params.id,1)
	let file 
	if (ticker){
		if (outCab) {
			if (ticker=='ref')  return (res.writeHead(301,{Location:'https://app.ref.finance/pools','cache-control':'no-store'}),res.end())
			const links = {'nearusd':'BINANCE:NEARUSDT', 'nearrub':'BINANCE:NEARUSD*BINANCE:USDTRUB', 'nearuah':'BINANCE:NEARUSD*BINANCE:USDTUAH'}
			if (charts.about){
				if (!charts[ticker]) return (res.writeHead(301,{Location:'https://near.watch','cache-control':'no-store'}),res.end())
				if (charts.widget && links[ticker]) return (res.writeHead(200),res.end(charts.about.replace('%WIDGET%',charts.widget.replace(new RegExp('%TICKER%','ig'),links[ticker]))))
			} 
			if (links[ticker]) return (res.writeHead(301,{Location:'https://www.tradingview.com/chart/?symbol='+links[ticker],'cache-control':'no-store'}),res.end())
		}
		if (req.headers['user-agent'] == 'TelegramBot (like TwitterBot)'){
			file = fs.readFileSync('near.watch.gif')
			res.writeHead(200,{'content-type':'image/gif'})
			return res.end(file,'binary')
		}
		try{
			file = fs.readFileSync(svgPath+ticker+'_out.svg')
			res.writeHead(200,{'content-type':'image/svg+xml'})
			return res.end(file,'binary')
		}catch(err){console.log(err)}
		try{
			file = fs.readFileSync(svgPath+ticker+'_out.jpg')
			res.writeHead(200,{'content-type':'image/jpeg'})
			return res.end(file,'binary')
		}catch(err){console.log(err)}
	} 
	if (outCab) return (res.writeHead(301,{Location:'https://near.watch','cache-control':'no-store'}),res.end())
	res.writeHead(200,{'content-type':'image/jpeg'})
	res.end(file,'binary')
}
startPage = async (req,res) => {
	res.writeHead(200)
	res.end(charts.about?charts.about.replace('%WIDGET%',''):'Under construction')
}

function loadPages(){
	for (const fn of fs.readdirSync('./')){
		if (fn.substr(-5)=='.html'){
			try {
				charts[fn.split('.')[0]] = fs.readFileSync(fn,'utf8').toString()
			} catch(err){}
		}
	}
}
loadPages()

